import React from 'react';
import { useState } from 'react';

export default function Malfunctions() {

    const [malfunctionName,setMalfuntcionName] = useState();
    const [malfunctionCode,setMalfunctionCode] = useState();
    const [malfunctionDescripion,setMalfunctionDescripion] = useState();
    const [malfunctionTuneUpTime,setMalfunctionTuneUpTime] = useState();
    const [malfunctionPrice, setMalfunctionPrice] = useState();

    return (
      <div>
        <form>
          <input type="text" placeholder="Malfunction name" />
          
          <input type="text" placeholder="Malfunction code" />
          
          <input type="text" placeholder="Malfunction description" />
          
          <input type="text" placeholder="Malfunction tune-up time" />
          
          <input type="text" placeholder="Malfunction price" />
        </form>
      </div>
    );
}
